/**
 * @brief crc32c computes the CRC32 (Castagnoli) check value of an input data.
 * @tparam W byte number of input data, the value of W includes 1, 2, 4, 8, 16, 32, 64.
 * @param crcInitStrm initialize crc32 value
 * @param inStrm input messages to be checked
 * @param inLenStrm lengths of input message
 * @param endInStrm end flag of inLenStrm
 * @param outStrm crc32 result to output
 * @param endOutStrm end flag of outStrm
 */
template <int W>
void crc32c(hls::stream<ap_uint<32> >& crcInitStrm,
            hls::stream<ap_uint<8 * W> >& inStrm,
            hls::stream<ap_uint<32> >& inLenStrm,
            hls::stream<bool>& endInStrm,
            hls::stream<ap_uint<32> >& outStrm,
            hls::stream<bool>& endOutStrm) {
#pragma HLS array_partition variable = internal::table_crc32c dim = 1 block factor = W
    bool e = endInStrm.read();
    while (!e) {
        ap_uint<32> len = inLenStrm.read();
        e = endInStrm.read();

        ap_uint<32> crc = crcInitStrm.read();
        ap_uint<8 * W> in_data;
        if (W == 1) {
            for (uint64_t i = 0; i < len; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table_crc32c[0][crc(7, 0) ^ in_data];
            }
        } else if (W == 2) {
            for (uint64_t i = 0; i < len / W; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                ap_uint<16> inTmp = in_data ^ crc(15, 0);
                crc = crc(31, 16) ^ internal::table_crc32c[0][inTmp(15, 8)];
                crc ^= internal::table_crc32c[1][inTmp(7, 0)];
            }
            if (len % W) {
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table_crc32c[0][crc(7, 0) ^ in_data.range(7, 0)];
            }
        } else {
            for (uint64_t i = 0; i < len / W; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                const int NUM = W / 4;
                ap_uint<32> inTmp[NUM];
                for (int j = 0; j < NUM; j++) {
                    if (j == 0)
                        inTmp[j] = in_data(31 + 32 * j, 32 * j) ^ crc;
                    else
                        inTmp[j] = in_data(31 + 32 * j, 32 * j);
                }
                crc = internal::table_crc32c[0][inTmp[W / 4 - 1](31, 24)];
                for (int j = 1; j < W; j++) {
                    int index = j / 4;
                    int offset = j % 4;
                    crc ^= internal::table_crc32c[j][inTmp[W / 4 - 1 - index](31 - offset * 8, 24 - offset * 8)];
                }
            }

            ap_uint<6> resdu_byte = len - (len / W) * W;
            if (resdu_byte > 0) {
                in_data = inStrm.read();
                in_data(31, 0) = in_data(31, 0) ^ crc;

                ap_uint<8 * W> tmp = in_data << (8 * (W - resdu_byte));
                if (resdu_byte == 1)
                    crc = crc(31, 8) ^ internal::table_crc32c[0][tmp(W * 8 - 1, W * 8 - 8)];
                else if (resdu_byte == 2)
                    crc = crc(31, 16) ^ internal::table_crc32c[0][tmp(W * 8 - 1, W * 8 - 8)];
                else if (resdu_byte == 3)
                    crc = crc(31, 24) ^ internal::table_crc32c[0][tmp(W * 8 - 1, W * 8 - 8)];
                else
                    crc = internal::table_crc32c[0][tmp(W * 8 - 1, W * 8 - 8)];
                for (int i = 1; i < W - 1; i++) {
#pragma HLS unroll
                    if (i < resdu_byte) {
                        crc ^= internal::table_crc32c[i][tmp(7 + 8 * (W - 1 - i), 8 * (W - 1 - i))];
                    }
                }
            }
        }
        outStrm.write(~crc);
        endOutStrm.write(false);
    }
    endOutStrm.write(true);
}

/**
 * @brief crc32c computes the CRC32 (Castagnoli) check value of an input data.
 * @tparam W byte number of input data, the value of W includes 1, 2, 4, 8, 16, 32, 64.
 * @param crcInitStrm initialize crc32 value
 * @param inStrm input messages to be checked
 * @param inPackLenStrm effetive lengths of input message pack, 1~W. 0 means end of message
 * @param endInPackLenStrm end flag of inPackLenStrm, 1 "false" for 1 message, 1 "true" means no message anymore.
 * @param outStrm crc32 result to output
 * @param endOutStrm end flag of outStrm
 */
template <int W>
void crc32c(hls::stream<ap_uint<32> >& crcInitStrm,
            hls::stream<ap_uint<8 * W> >& inStrm,
            hls::stream<ap_uint<7> >& inPackLenStrm,
            hls::stream<bool>& endInPackLenStrm,
            hls::stream<ap_uint<32> >& outStrm,
            hls::stream<bool>& endOutStrm) {
#pragma HLS array_partition variable = internal::table_crc32c dim = 1 block factor = W
    bool e = endInPackLenStrm.read();
    while (!e) {
        ap_uint<7> inPackLen = inPackLenStrm.read();

        ap_uint<32> crc = crcInitStrm.read();
        ap_uint<8 * W> in_data;
        if (W == 1) {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                crc = (crc >> 8) ^ internal::table_crc32c[0][crc(7, 0) ^ in_data];
            }
        } else if (W == 2) {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                ap_uint<16> inTmp = in_data ^ crc(15, 0);
                crc = crc(31, 16) ^ internal::table_crc32c[0][inTmp(15, 8)];
                crc ^= internal::table_crc32c[1][inTmp(7, 0)];
            }
            if (inPackLen != 0) {
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table_crc32c[0][crc(7, 0) ^ in_data.range(7, 0)];
                inPackLen = inPackLenStrm.read();
            }
        } else {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                const int NUM = W / 4;
                ap_uint<32> inTmp[NUM];
                for (int j = 0; j < NUM; j++) {
                    if (j == 0)
                        inTmp[j] = in_data(31 + 32 * j, 32 * j) ^ crc;
                    else
                        inTmp[j] = in_data(31 + 32 * j, 32 * j);
                }
                crc = internal::table_crc32c[0][inTmp[W / 4 - 1](31, 24)];
                for (int j = 1; j < W; j++) {
                    int index = j / 4;
                    int offset = j % 4;
                    crc ^= internal::table_crc32c[j][inTmp[W / 4 - 1 - index](31 - offset * 8, 24 - offset * 8)];
                }

                // crc = internal::table_crc32c[15][inTmp[0](7, 0)] ^ internal::table_crc32c[14][inTmp[0](15, 8)] ^
                //      internal::table_crc32c[13][inTmp[0](23, 16)] ^ internal::table_crc32c[12][inTmp[0](31, 24)]
                //      ^
                //      internal::table_crc32c[11][inTmp[1](7, 0)] ^ internal::table_crc32c[10][inTmp[1](15, 8)] ^
                //      internal::table_crc32c[9][inTmp[1](23, 16)] ^ internal::table_crc32c[8][inTmp[1](31, 24)] ^
                //      internal::table_crc32c[7][inTmp[2](7, 0)] ^ internal::table_crc32c[6][inTmp[2](15, 8)] ^
                //      internal::table_crc32c[5][inTmp[2](23, 16)] ^ internal::table_crc32c[4][inTmp[2](31, 24)] ^
                //      internal::table_crc32c[3][inTmp[3](7, 0)] ^ internal::table_crc32c[2][inTmp[3](15, 8)] ^
                //      internal::table_crc32c[1][inTmp[3](23, 16)] ^ internal::table_crc32c[0][inTmp[3](31, 24)];
            }

            if (inPackLen != 0) {
                for (ap_uint<7> i = 0; i < inPackLen; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = W min = W
                    if (i == 0) in_data = inStrm.read();
                    crc = (crc >> 8) ^ internal::table_crc32c[0][crc(7, 0) ^ in_data.range(7 + 8 * i, 8 * i)];
                }
                inPackLen = inPackLenStrm.read();
            }
        }
        outStrm.write(~crc);
        endOutStrm.write(false);
        e = endInPackLenStrm.read();
    }
    endOutStrm.write(true);
}

